import React, { Component } from 'react';
import './Styles/Heading.css'

class Heading extends Component {
    constructor(){
        super();
        this.changingText=['cool','super','wonderful','soulful','modern'];
        this.state = {index:0}
    }

    render() {
        return (
            <div id="Heading">
                <div class="HeadingDiv"><h1 id="HeadingText">MAAXO</h1></div>
                <div id="ChangingText"></div>
            </div>
        );
    }
}

export default Heading;
